import { Text, TextInput } from "react-native";
import componentsStyle from "../styles/components";

const types = {
    "decimal": "decimal-pad",
    "number": "numeric"
}

const LabelInput = ({ text, type, ...properties }) => {
    return (<>
        <Text style={componentsStyle.labelInputText}>{text}:</Text>
        <TextInput style={componentsStyle.labelInput} keyboardType={types[type]} {...properties}/>
    </>);
}

export {
    LabelInput
}
